import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./styles.css";

import NavBar from "./components/NavBar";
import Hero from "./components/Hero";
import ElsNostresEspais from "./components/ElsNostresEspais";
import Footer from "./components/Footer"; // Ajoute cette ligne en haut de ton fichier
import ViuLaNatura from "./pages/ViuLaNatura"; // Corrected import path for EspaiDeNatura
import ViuLaCiutat from "./pages/ViuLaCiutat";
import EspaisDeNegoci from "./pages/EspaisDeNegoci";
import PoligonIIndustria from "./pages/PoligonIIndustria";

export default function App() {
  return (
    <Router>
      <NavBar />
      <Routes>
        <Route
          path="/"
          element={
            <>
              <Hero />
              <ElsNostresEspais />
            </>
          }
        />
        <Route path="/viu-la-natura" element={<ViuLaNatura />} />
        <Route path="/viu-la-ciutat" element={<ViuLaCiutat />} />
        <Route path="/espais-de-negoci" element={<EspaisDeNegoci />} />
        <Route path="/poligon-i-industria" element={<PoligonIIndustria />} />
      </Routes>
      <Footer /> {/* Ajoute le Footer ici */}
    </Router>
  );
}
